import React from "react";
import { connect } from 'react-redux';
import { fetchStreams } from '../../actions/index';

const StreamList = () => {
    return (
        <div>StreamList</div>
    )
}

export default connect(null, { fetchStreams: fetchStreams}) (StreamList);
